import styled from "styled-components"; // REQUIRED for SC
const AddUserButton = (props) => {
  return <Btn></Btn>;
};
export default AddUserButton;

//% SC-CSS incoming
const Btn = styled.button`
  font: inherit;
  border: 1px solid #4f005f;
  background: #4f005f;
  color: white;
  padding: 0.25rem 1rem;
  cursor: pointer;

  &:hover,
  &:active {
    background: #741188;
    border-color: #741188;
  }

  &:focus {
    outline: none;
  }
`;
